igh efficiencies even in inclement weather, such as 'super black' solar cells, but most of these are still either expensive or not yet commercially available.<\/p><br><p>Roof space available for solar panels. One obvious factor to be taken into consideration when mounting panels on a roof is the amount of space available on it. A typical polycrystalline or monocrystalline panel measures about 1.6m x 1m, and depending on the capacity (size in watts) of your system, for an average 2 or 3-bedroom home, you should be able to fit enough panels to significantly offset your electricity costs on one, or in a stretch, two parts of your roof. Closeness of the panels to your home is not an absolute requirement: the roofs of sheds, garages, and balconies that stand slightly apart from your house may also provide options for placement.<\/p><\/div>"));JC(b,50,d);KC(b)};_.cM={10:1,21:1};_=BP.prototype=uP.prototype=new xv;_.gC=function CP(){return bq};var vP;_=GP.prototype=DP.prototype=new bx;_.gC=function HP(){return cq};var EP=null;_=SP.prototype=IP.prototype=new u;_.gC=function TP(){return eq};_.tS=function UP(){return RP(this)};_.cM={48:1,74:1};_.e=null;_.f=null;_.g=null;_.i=null;_.j=null;_.k=null;_=ZP.prototype=WP.prototype=new u;_.gC=function $P(){return fq};_.tS=function _P(){return QT+VQ(this.a)+PT};_.cM={48:1};_.a=null;_=nQ.prototype=aQ.prototype=new u;_.gC=function oQ(){return gq};_.tS=function pQ(){return mQ(this)};_.cM={48:1};_.a=null;_.b=null;_.c=null;_.d=null;_.e=null;_.f=null;_.g=null;_.i=null;_=UQ.prototype=qQ.prototype=new u;_.gC=function WQ(){return iq};_.tS=function XQ(){return TQ(this)};_.cM={48:1};_.d=null;_.e=null;_.f=null;_=ZQ.prototype=YQ.prototype=new Wb;_.gC=function $Q(){return hq};_.cM={48:1,57:1,67:1,75:1};var dR=vc;var dp=VH(ST,'Object'),Tk=VH(TT,'AjaxKeyConstants_'),jp=VH(ST,nR),Cq=UH(UT,'String;'),Uk=VH(TT,'AjaxLoader$1'),kp=VH(ST,'Throwable'),Vo=VH(ST,'Exception'),al=VH(VT,'Animation'),Vk=VH(VT,'Animation$1'),_k=VH(VT,'AnimationScheduler'),Wk=VH(VT,
